USE [master]

IF EXISTS(SELECT * FROM sys.databases WHERE name = 'QLBH')
BEGIN
	DROP DATABASE QLBH
END;

CREATE DATABASE QLBH;

USE [QLBH];
IF EXISTS (SELECT 1
            FROM  SYSOBJECTS
           WHERE  ID = OBJECT_ID('CT_HoaDon')
            AND   TYPE = 'U')
   DROP TABLE CT_HoaDon
GO

IF EXISTS (SELECT 1
            FROM  SYSOBJECTS
           WHERE  ID = OBJECT_ID('SanPham')
            AND   TYPE = 'U')
   DROP TABLE SanPham
GO
IF EXISTS (SELECT 1
            FROM  SYSOBJECTS
           WHERE  ID = OBJECT_ID('HoaDon')
            AND   TYPE = 'U')
   DROP TABLE HoaDon
GO
IF EXISTS (SELECT *
            FROM  SYSOBJECTS
           WHERE  ID = OBJECT_ID('KhachHang')
              AND TYPE = 'U')
   DROP TABLE KhachHang
GO

CREATE TABLE KhachHang
(
	MaKH		VARCHAR(20)	NOT NULL,
	Ho		NVARCHAR(15)	NOT NULL, 
	Ten		NVARCHAR(10)	NOT NULL,
	NgaySinh	DATETIME,
	SoNha		NVARCHAR(20),
	Duong		NVARCHAR(20),
	Phuong		NVARCHAR(20),
	Quan		NVARCHAR(20),
	Tpho		NVARCHAR(20),
	DienThoai	VARCHAR(10),

	CONSTRAINT PK_KH PRIMARY KEY (MaKH)
);

CREATE TABLE SanPham
(
	MaSP		VARCHAR(20)		NOT NULL,  
	TenSP		NVARCHAR(100)	NOT NULL, 
	SoLuongTon	INT,
	MoTa	NVARCHAR(100),
	Gia	INT,

	CONSTRAINT PK_SP PRIMARY KEY (MaSP)
);

CREATE TABLE HoaDon
(
	MaHD	VARCHAR(20) NOT NULL,
	MaKH	VARCHAR(20) NOT NULL,  
	NgayLap	DATETIME,
	TongTien INT,
	
	CONSTRAINT PK_HD PRIMARY KEY (MaHD)
);

CREATE TABLE CT_HoaDon
(
	MaHD	VARCHAR(20) NOT NULL,  
	MaSP	VARCHAR(20) NOT NULL,  
	SoLuong	INT,
	GiaBan	INT,
	GiaGiam	INT,
	ThanhTien INT,
	
	CONSTRAINT PK_CTHD PRIMARY KEY (MaHD,MaSP)
);

ALTER TABLE	HoaDon ADD CONSTRAINT FK_KH_HD FOREIGN KEY (MaKH) REFERENCES KhachHang(MaKH);
ALTER TABLE CT_HoaDon ADD CONSTRAINT FK_CTHD_HD FOREIGN KEY (MaHD) REFERENCES HoaDon(MaHD);
ALTER TABLE CT_HoaDon ADD CONSTRAINT FK_CTHD_SP FOREIGN KEY (MaSP) REFERENCES SanPham(MaSP);


USE QLBH
GO

IF DB_NAME() <> N'QLBH' SET NOEXEC ON
GO

